import React from 'react';

function Home() {

    const home =
        <div className="container-fluid p-0">
            <div className="row border-bottom border-secondary">
                <div className="col-1 border pb-1">
                    <img src="./static/images/logo.png" className="w-100 h-100 " alt="GoVersus" />
                </div>
                <div className="col-2 border">
                    <h1>
                        GoVersus
                    </h1>
                </div>
            </div>

        </div>

    return (home);
}

export default Home;
